module.exports = JSON.parse('{"title":"Instituto AdressForAll","menu":{"home":"Inicio","whoweare":"Quines Somos","projects":"Proyectos","statute":"Estatutos","partners":"Colaboradores","data":"Datos","downloads":"Downloads","visualization":"Visualizacin","metadata":"Metadatos","documentation":"Documentacin","tools":"Herramientas","api":"API","faq":"FAQ","contribute":"Contribuir","ourservices":"Nuestros Servicios","blog":"Blog","knowmore":"Saber Ms","opendataportal":"Portal de Datos Abiertos","backtohome":"Volver al Inicio"},"contact":"Contacto","home":{"advertisment":{"message":"El sitio de la base de datos de direcciones abierta, colaborativa y","remark":"gratuita"},"regionalmap":{"message":"Regiones en las que operamos, buscando direcciones en el dominio pblico, con personal voluntario y","remark":"remunerado"},"aboutus":{"message":"El Instituto AddressForAll es una ONG sin nimo de lucro que mantiene una base de datos de direcciones abierta, colaborativa y gratuita. Remuneramos a los equipos que realizan un trabajo proactivo de bsqueda de datos, en los pases donde operamos."},"downloads":{"message":"Nuestros datos estn disponibles para su descarga, con la informacin del tipo de licencia abierta de cada dato (CC0, CCBY o CCBYSA, o equivalente)."}},"about":{"whoweare":{"title":"Quines somos?","text":"El Instituto de Tecnologas GeosSociales AddressForAll tiene como objetivo promover los datos abiertos y la mejora social mediante el buen uso de la tecnologa, haciendo nfasis en las tecnologas geoespaciales."},"historic":{"title":"Antecedentes","text":"Como parte de su trabajo de apoyo al proyecto de mapas colaborativos OpenStreetMap, durante 3 aos, los fundadores del Instituto trataron de motivar al gobierno brasileo para crear una base de datos de direcciones abierta y colaborativa en Brasil. Al ver que el proyecto no pasaba de la ideacin por falta de voluntad poltica o de fuerza, Thierry Jean, Filipe Rocha y Peter Krauss decidieron lanzar el proyecto \\"AddressForAll\\" en 2020 y crearon una asociacin sin nimo de lucro llamada \\"Instituto de Tecnologas GeoSociales AddressForAll\\"."},"founders":{"title":"Fundadores"},"consultants":{"title":"Consejo Consultivo"},"itcrowd":{"title":"Equipo TcnicoOperativo"},"statutes":{"message":"En el siguiente enlace puede consultar una versin abreviada de nuestros estatutos, as como acceder a las distintas versiones de estos en su totalidad."}},"statutes":{"md":"# Eatatutos\\n Nostrud laborum nostrud reprehenderit exercitation tempor Lorem pariatur. Lorem consectetur sint officia laborum qui et ad. Id exercitation ad ipsum deserunt aliquip velit. Aliqua in consequat est cillum. Sint pariatur pariatur aliquip consequat dolore minim cillum proident aute aute labore aliqua. Ipsum id reprehenderit occaecat eiusmod cupidatat ipsum ea nisi anim in deserunt magna est id. Ex incididunt qui sint ea Lorem."},"projects":{"title":"Nuestros Proyectos","text":"El proyecto AddressForAll es uno de los varios proyectos que tiene el Instituto.","project01":{"title":"AddressForAll  Direccin para Todos","excerpt":"Este fue el primer proyecto del instituto. El proyecto mantiene una base de direcciones de colaboracin abierta.","text":"El proyecto gestiona una base de direcciones de colaboracin abierta.<br/> Para que los servicios de emergencia lleguen al lugar correcto, para permitir el anlisis cartogrfico en unos pocos clics o incluso para que los operadores pblicos y privados coordinen mejor sus trabajos, las direcciones son una verdadera cuestin de soberana para cualquier pas."},"project02":{"title":"Cdigo de Enrutamiento Postal","excerpt":"El CEP (Codigo Postal Brasileo) es privado? El CRP sortea legalmente esta incoherencia.","text":"En Brasil, al ser el CEP un dato privado de Correos, los municipios y los gobiernos no pueden elaborar una lista de los CEP de su inters. El proyecto sortea esta incoherencia, ofreciendo a la sociedad una lista de cdigos diferentes a los cdigos postales, pero que pueden tener la misma utilidad."},"project03":{"title":"OSM Codes","excerpt":"El ser humano tiene dificultades para memorizar la latitud/longitud. El Geocodigo crea un cdigo corto y fcil de recordar para sealar un rea de 4m x 4m.","text":"A Latitud Longitud es un cdigo muy difcil de manejar y recordar para los humanos. Sin embargo, sealar una ubicacin en el mapa es necesario para todos, sobre todo para los lugares donde no hay direcciones de calidad, como en los barrios marginales, los desiertos, las sbanas, etc. Los geocdigos son cdigos ms fciles de recordar, sobre todo si desarrollamos geocdigos ms cortos. Este proyecto lleva a cabo una investigacin acadmica para desarrollar la mejor tecnologa de geocodificacin y llevarla a los gobiernos y a la sociedad. Esta tecnologa debera tener en cuenta y armonizarse con las rejillas estadsticas, porque los estudios estadsticos, cada vez ms, son geoespaciales."},"project04":{"title":"Preservacin Digital","excerpt":"Conservamos durante dcadas datos que los gobiernos pierden fcilmente.","text":"Conservamos, durante dcadas, datos que los gobiernos pierden fcilmente."},"project05":{"title":"Gobierno GeoDigital","excerpt":"Concienciar a los gobiernos de la importancia de la geografa en los servicios digitales y ayudarles.","text":"Los gobiernos son conscientes de la importancia de la digitalizacin de sus servicios, pero la cultura de la geolocalizacin an no est extendida. Todo el mundo quiere ver todo en un mapa, pero los gestores a menudo no saben ni por dnde empezar para conseguirlo. El proyecto de Gobierno Geo Digital pretende concienciar a los gobiernos de la importancia de la geografa en los servicios pblicos, as como sealar formas concretas de aplicarla y beneficiarse de ella."},"project06":{"title":"Alerta Primera Infancia","excerpt":"El proyecto desarrolla una plataforma tecnolgica para alertar a los municipios cuando los nios de la primera infancia estn en situacin de vulnerabilidad.","text":"El proyecto desarrolla una plataforma tecnolgica para alertar a los municipios cuando los nios de la primera infancia estn en situacin de vulnerabilidad."}},"partners":{"md":"# Colaboradores\\n Veniam eiusmod anim pariatur laboris exercitation aliquip dolore dolore nisi est anim cupidatat proident culpa. Nostrud mollit sunt aute officia Lorem proident culpa ut proident id. Minim fugiat magna nisi excepteur cupidatat consectetur minim Lorem. Magna reprehenderit et enim occaecat culpa incididunt amet nostrud."},"data":{"title":"Datos","text":"Tenemos un equipo que llama a los titulares de los datos y los motiva para que donen datos al proyecto AddressForAll, con licencias libres. Siempre recomendamos la publicacin de datos en el dominio pblico y el uso de la <strong>licencia CC0,</strong> pero tambin aceptamos datos con licencia CCBY y CCBYSA.","phases":{"text":"Nuestros datos estn disponibles en 3 fases de tratamiento:","phase01":{"title":"Datos Preservados","text":"<p>Los datos y las licencias del <strong>proyecto DigitalGuard</strong> estn estrictamente controlados y se conservan igual que los originales recibidos de los donantes. Son los \\"datos brutos\\", sin estandarizar y en muchos formatos diferentes (CSV, Shapefile, GeoJSON, etc.). <strong>Se conservan durante 20 aos,</strong> y durante ese tiempo se pueden descargar, tal y como los recibimos.</p>"},"phase02":{"title":"Datos Filtrados","text":"<p>Al ser de origen diverso, los datos conservados deben ser filtrados y normalizados. El proyecto AddressForAll realiza un <strong>recorte centrado en direcciones.</strong> La estructura del recorte est estandarizada y se publica en formato GeoJSON, a travs de PostgreSQL en repositorios git.</p> <p><strong>Todo el proceso de filtrado y publicacin es abierto y reproducible,</strong> cualquiera puede auditarlo. Los resultados  <strong>no se someten a validacin,</strong> y la misma direccin puede ser descrita y repetida por diferentes fuentes, como el municipio, la empresa del agua y la empresa de logstica.</p>"},"phase03":{"title":"Datos Consolidados","text":"<p>La consolidacin consiste en agregar estadsticamente la informacin de varias fuentes sobre una misma direccin y sus alrededores y aplicar algoritmos de <strong>validacin.</strong> En el proceso, las direcciones reconocidas como duplicadas se reducen a una nica direccin y las no vlidas se descartan.</p> <p>Obtenemos tanto la <strong>puntuacin de fiabilidad</strong> de los datos originales como la <strong>posicin ms probable</strong> del punto de direccin. Los nombres de las calles reciben una estandarizacin terminolgica y la numeracin de los edificios puede optimizarse mediante el promedio, el reposicionamiento o la interpolacin. Esta base es la que se utiliza para nuestras API de bsqueda y geocodificacin <strong>(en construccin).</strong></p>"}}},"documentation":{"md":"# Documentacin\\n Los datos puestos a disposicin por el Instituto AddressForAll pueden analizarse en nuestras API o descargarse, por partes (datos locales de un municipio, por ejemplo) y por etapa de su ciclo de procesamiento. A continuacin se describen brevemente los conjuntos de datos resultantes de cada uno de estos pasos. Para los detalles tcnicos, consulte la [documentacin](https://github.com/AddressForAll)"},"visualization":{"md":"# Visualizacin de los Datos\\n Puedes explorar los datos, antes de descargarlos.","html":"<h1>Visualizacin de los Datos</h1>\\n <p>Puedes explorar los datos, antes de descargarlos.</p>"},"downloads":{"md":"# Downloads\\n Los datos puestos a disposicin por el Instituto AddressForAll pueden descargarse por municipio (datos locales) o a nivel nacional.","html":"<h1>Downloads</h1>\\n <p>Los datos puestos a disposicin por el Instituto AddressForAll pueden descargarse por municipio (datos locales) o a nivel nacional.</p>"},"apis":{"md":"# APIs\\n Las APIs del Portal del Instituto AddressForAll corresponden a funcionalidades de acceso directo a nuestra base de datos, es decir, se puede acceder a los Datos descritos tanto indirectamente a travs de nuestros repositorios git, como directamente a travs de nuestras APIs. Para los detalles tcnicos, consulte la [documentacin](https://github.com/AddressForAll)","html":"<h1>APIs</h1>\\n <p>Las APIs del Portal del Instituto AddressForAll corresponden a funcionalidades de acceso directo a nuestra base de datos, es decir, se puede acceder a los Datos descritos tanto indirectamente a travs de nuestros repositorios git, como directamente a travs de nuestras APIs. Para los detalles tcnicos, consulte la <a href=\\"https://github.com/AddressForAll\\">documentacin</a></p>"},"services":{"md":"# Servicios\\n <h2>Patrocinio:</h2>\\n Contamos con el patrocinio de empresas y entidades, interesadas en que el proyecto crezca. Tenemos un equipo que llama a los titulares de los datos y los motiva a donar sus datos al proyecto AddressForAll, con licencias gratuitas. Hacemos un trabajo activo de defensa de los datos abiertos y enseamos a los gobiernos a publicar sus datos en el dominio pblico con la licencia CC0, que es la ms adecuada.\\n\\n Podemos hacer campaas especficas en regiones o pases, a peticin de un patrocinador, pero el resultado del trabajo est abierto a todos. Si su empresa aprovecha los datos del Instituto AddressForAll, pngase en contacto con nosotros para contribuir econmicamente a este esfuerzo y que el proyecto pueda crecer.\\n <h2>Servicios para los Gobiernos:</h2>\\n A veces los gobiernos desean orquestar un proyecto de base de datos de direcciones abierta en su territorio, pero carecen de presupuesto, estructura organizativa o competencia para hacerlo. Estos gobiernos pueden contratar al Instituto AddressForAll para que organice y opere el proyecto en su pas.\\n\\n El desarrollo del proyecto puede conducir a la propuesta de nuevas leyes que mejoren la gestin de las direcciones, como hemos visto en Francia o Uruguay, por ejemplo."},"contribute":{"md":"# Contribuir\\n El Instituto AddressForAll cuenta con la colaboracin de todos. Si su empresa o el organismo gubernamental en el que participa tiene datos relevantes, pngase en contacto con nosotros. Aunque se considere que los datos no son fiables, al cruzarlos con otros datos, pueden ayudar mucho a la calidad final del trabajo.\\n\\n Los datos obtenidos no tienen que ser necesariamente de direcciones. Cuando recibamos ortofotos o archivos cartogrficos completos, intentaremos poner estos datos a disposicin de la comunidad de OpenStreetMap para facilitar su trabajo de cartografiar el mundo.\\n\\n Si quiere ser embajador del proyecto AddressForAll en su regin o sector, puede hacer mucho para ayudarnos a construir una excelente base de direcciones abiertas.\\n  <h2>O</h2>\\n Si quieres compartir tus impresiones y consejos para que mejoremos constantemente, ponte en contacto con nosotros. Todas las contribuciones son bienvenidas."},"faq":{"title":"Preguntas Frecuentes FAQ","dados":{"title":"Datos","q01":{"q":"He presentado una base de datos geogrfica de mi municipio. Puedo ver estos datos en AddressForAll?","a":{"text":"S. Los datos recibidos estn disponibles de 3 maneras:","pt01":"Datos preservados. Cada paquete se conserva durante 20 aos, guardamos los datos tal y como los recibimos y los ponemos a disposicin para su descarga;","pt02":"Datos filtrados, disponibles casi en bruto, a travs de mapas, estadsticas o descargas. Estos datos se someten a un tratamiento previo (slo se procesa la estructura de los datos originales);","pt03":"Datos consolidados, con contenido posiblemente modificado, disponibles en servicios, API y descargas. Ya no sern \\"sus datos\\", ya que su contribucin puede ser descartada o mezclada en forma de media con otros datos.","subtext":"Hay varios tipos de modificacin, veamos algunos ejemplos. El Instituto puede decidir consolidar los nombres de las calles, por ejemplo sustituyendo todas las abreviaturas \\"Av.\\" por \\"Avenida\\". Si los puntos de direccin estn situados en el centro de la parcela, el Instituto reubicar el punto en la parte delantera de la parcela, cerca de la calle."}},"q02":{"q":"Puedo ver la licencia de los datos?","a":{"text":"<p>S. Para cada tipo de datos (preservados, filtrados y consolidados), puede haber una licencia diferente. Los datos originales y filtrados reciben la licencia de los datos originales del donante. Los datos consolidados reciben una licencia segn los originales rastreables, y en el caso de datos iguales con diferentes licencias, se adopta la ms abierta (menos restrictiva), variando en el espectro de \\"familias de licencias\\" desde CC0 hasta CCBYNCSA, pero con la mayora en CC0.</p> <p>Cuando los datos originales proceden de un organismo pblico, aunque no tenga licencia, est implcita la prevista por la legislacin del pas (o jurisdiccin ms especfica).</p> <p>Por ejemplo, en Brasil, aplicamos la siguiente regla:</p>","pt01":"Datos de los rganos federales: son siempre CC0.","pt02":"Datos de los rganos municipales o estatales: son en general implcitamente abiertos como los federales, pero pueden depender de una legislacin especfica.","subtext":"Los datos consolidados, al tener valor aadido por el Instituto, reciben la licencia de eleccin del Instituto, que es CC0 siempre que sea posible."}},"q03":{"q":"Puedo descargar los datos y combinarlos con mi base de datos interna?","a":"<p>S y no. AddresForAll pretende trabajar con datos abiertos, y hay dos licencias disponibles. La primera, CC0, le permite hacer \\"todo\\". Puede descargar los datos, mezclarlos con datos privados y declarar el nuevo conjunto como privado.</p> <p>La licencia CCBYSA, similar a la ODbL, utilizada por ejemplo por OpenStreetMap, no es tan permisiva, y puede \\"contaminar\\" la base que recibe los datos. La base de datos resultante de la combinacin de ambos datos ya no puede ser \\"privada\\" ni redistribuida bajo la licencia CC0, sino slo bajo la licencia CCBYSA. Esto puede ser inapropiado para los organismos gubernamentales que se comprometen a publicar sus datos en el dominio pblico, por ejemplo, en el diario oficial.</p>"},"q04":{"q":"Puedo aportar datos?","a":"S, pngase en contacto con nosotros."}}}}');

